INSERT INTO `mst_email_designer_template` VALUES (1,1,'Welcome',NULL,10,'Welcome to {{ store.store_name }}!','{\"header\":\"<h1>Welcome {{ customer.firstname }}!<\\/h1>\",\"content\":\"<p>Thank you for joining <a href=\\\"{{ store.store_url }}\\\">{{ store.store_name }}<\\/a>. We are so happy your are here!<\\/p>\",\"footer\":\"{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  To show our appreciation, we are giving you a <b>10% discount<\\/b>, enjoy your next purchase with code <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span> at checkout.\\n<\\/div>\\n\\n<table class=\\\"button\\\" width=\\\"100%\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\\n  <tr>\\n    <td>\\n      <table class=\\\"inner-wrapper\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\\n        <tr>\\n          <td align=\\\"center\\\">\\n            <a href=\\\"{{ store.store_url }}\\\">Shop Now<\\/a>\\n          <\\/td>\\n        <\\/tr>\\n      <\\/table>\\n    <\\/td>\\n  <\\/tr>\\n<\\/table>\\n{% endif %}\\n\\n<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(2,1,'Anniversary',NULL,11,'A great big thank you!','{\"header\":\"<h1>Happy Anniversary!<\\/h1>\",\"content\":\"<p>We just wanted to say thank you for being a 1-year {{ store.store_name }} customer!<\\/p>\\n<p>We hope the experience met your expectations.<\\/p>\\n\\n{% if coupon.code %}\\n<p style=\\\"text-align:center;\\\">\\n   <span style=\\\"font-size: 55px; font-weight: bold;\\\">Enjoy<\\/span> <span style=\\\"font-size: 95px; font-weight: bold;\\\">15%<\\/span> <span style=\\\"font-size: 55px; font-weight: bold;\\\">off<\\/span>\\n<\\/p>\\n\\n<div class=\\\"offer\\\">\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n\\n<table class=\\\"button\\\" width=\\\"100%\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\\n  <tr>\\n    <td>\\n      <table class=\\\"inner-wrapper\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\\n        <tr>\\n          <td align=\\\"center\\\">\\n            <a href=\\\"{{ store.store_url }}\\\">Shop Now<\\/a>\\n          <\\/td>\\n        <\\/tr>\\n      <\\/table>\\n    <\\/td>\\n  <\\/tr>\\n<\\/table>\\n{% endif %}\",\"footer\":\"<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(3,1,'Complementary offer: cross-sell products',NULL,12,'You may also like','{\"header\":\"<h1>Dear {{ customer_name }}<\\/h1>\",\"content\":\"<p>Thank you for your recent purchase #{{ order.increment_id }} from <a href=\\\"{{ store.store_url }}\\\">{{ store.store_name }}<\\/a>, we hope you enjoy it.<\\/p>\\n<p>Customers who made the same purchase also enjoyed the favorites below.<\\/p>\\n{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  We highly appreciate each and every our visitor, and it\'s extremely frustrating for us to lose you as a customer.<br>\\n  So let us offer you a <b>discount<\\/b> to complete your purchase.<br>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\",\"footer\":\"<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(4,1,'Complementary offer: related products',NULL,13,'We have few more related products for you','{\"header\":\"<h1>Hi {{ customer_name }}!<\\/h1>\",\"content\":\"<p>Thanks again for buying with us.<\\/p>\\n\\n<p>By using a mixture of magic and science, we\'ve determined that products below will definitely compliment your purchase.<\\/p>\\n<p>Feel free to buy some more goodies at your will :)<\\/p>\\n\\n{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  Let us offer you a <b>10% discount<\\/b>.<br>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\",\"footer\":\"\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(5,1,'Replenishment products',NULL,14,'Products you may want to buy again','{\"header\":\"<h1>Hello {{ customer_name }},<\\/h1>\",\"content\":\"<p>Thanks again for buying with us.<\\/p>\\n\\n<p>We hope you are enjoying items from your recent purchase.<\\/p>\\n<p>Your products should be finishing soon, so we thought you might be interesting in buying them again.<\\/p>\\n\\n<table width=\\\"0\\\" border=\\\"0\\\" cellspacing=\\\"5\\\" cellpadding=\\\"10\\\">\\n{% for item in this.all_visible_items %}\\n  <tr>\\n    <td><img src=\\\"{{ item.image | resize: \'image\', 300}}\\\" style=\\\"max-width: 15rem\\\"\\/><\\/td>\\n    <td valign=\\\"top\\\">\\n      <b><a href=\\\"{{ item.product.product_url | resume }}\\\">Review {{ item.name }}<\\/a><\\/b>\\n    <\\/td>\\n  <\\/tr>\\n{% endfor %}\\n<\\/table>\",\"footer\":\"{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  Let us offer you a <b>10% discount<\\/b>.<br>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\\n\\n<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(6,1,'Abandoned Cart',NULL,1,'You have abandoned your cart','{\"header\":\"<h1>Dear {{ customer_name }}!<\\/h1>\",\"content\":\"We noticed that for some unknown reason you had abandoned your cart at <a href=\\\"{{ store.store_url }}\\\">{{ store.store_name }}<\\/a> with the following item(s) in it:\\n\\n<table width=\\\"0\\\" border=\\\"0\\\" cellspacing=\\\"5\\\" cellpadding=\\\"10\\\">\\n{% for item in this.all_visible_items %}\\n<tr>\\n<td><img src=\\\"{{ item.image | resize: \'image\', 300}}\\\" style=\\\"max-width: 15rem\\\"\\/><\\/td>\\n<td valign=\\\"top\\\">\\n  <p><a href=\\\"{{ item.product.product_url }}\\\">{{ item.name }}<\\/a><\\/p>\\n  <b>{{ item.price | format_price }}<\\/b>\\n<\\/td>\\n<\\/tr>\\n{% endfor %}\\n<\\/table>\\n<table class=\\\"button\\\" width=\\\"100%\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\\n  <tr>\\n    <td>\\n      <table class=\\\"inner-wrapper\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\\n        <tr>\\n          <td align=\\\"center\\\">\\n            <a href=\\\"{{ url.restore_cart_url }}\\\">Finish Checkout<\\/a>\\n          <\\/td>\\n        <\\/tr>\\n      <\\/table>\\n    <\\/td>\\n  <\\/tr>\\n<\\/table>\",\"footer\":\"{% if coupon.code %}\\n  <div class=\\\"offer\\\">\\n    We highly appreciate each and every our visitor, and it\'s extremely frustrating for us to lose you as a customer. <br>\\n    Let us offer you a <b>discount<\\/b> to complete your purchase.<br>\\n    Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n  <\\/div>\\n{% endif %}\\n\\n<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(7,1,'Review Request',NULL,2,'Please add review for products you have bought','{\"header\":\"<h1>Dear {{ customer_name }}<\\/h1>\",\"content\":\"<p>Thank you for your recent purchase from <a href=\\\"{{ store.store_url }}\\\">{{ store.store_name }}<\\/a>.<\\/p>\\n<p>We hope the experience met your expectations. We always strive to offer the highest quality service to all of our customers, and we rely on your feedback to help us achieve this.<\\/p>\\n<p>We hope you\\u2019ll take a couple of minutes to write a review of your experience with our products.<\\/p>\\n\\n<table width=\\\"0\\\" border=\\\"0\\\" cellspacing=\\\"5\\\" cellpadding=\\\"10\\\">\\n{% for item in this.all_visible_items %}\\n  <tr>\\n    <td><img src=\\\"{{ item.image | resize: \'image\', 300}}\\\" style=\\\"max-width: 15rem\\\"\\/><\\/td>\\n    <td valign=\\\"top\\\">\\n      <b><a href=\\\"{{ item.product.product_url | resume }}\\\">Review {{ item.name }}<\\/a><\\/b>\\n    <\\/td>\\n  <\\/tr>\\n{% endfor %}\\n<\\/table>\",\"footer\":\"{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  We highly appreciate each and every our visitor, and it\'s extremely frustrating for us to lose you as a customer.<br>\\n  So let us offer you a <b>discount<\\/b> to complete your purchase.<br>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\\n<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(8,1,'Customer coming back',NULL,3,'Thank you for coming back to us!','{\"header\":\"<h1>Dear {{ customer_name }}!<\\/h1>\",\"content\":\"<p>Thank you for coming back to us! We really appreciate it!<\\/p>\",\"footer\":\"{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  Let us offer you a <b>discount<\\/b> to complete your purchase.<br>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\\n\\n<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(9,1,'Happy Birthday',NULL,4,'Happy Birthday','{\"header\":\"<h1>Dear {{ customer_name }}!<\\/h1>\",\"content\":\"<p>Light four candles on your special day: one for happiness, one for peace, one for prosperity and one for good luck. May you always be happy and healthy!<\\/p>\",\"footer\":\"{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  <p>Let us offer you a <b>discount<\\/b> to featurer purchases in this day.<\\/p>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\\n<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(10,1,'We miss you',NULL,5,'We miss you - please come back!','{\"header\":\"<h1>Dear {{ customer_name }}<\\/h1>\",\"content\":\"<h4 style=\\\"text-align:center;\\\">\\n    New products that can awake your interest have appeared in our store since your last visit.\\n<\\/h4>\\n<br><br>\\n\\n{% if coupon.code %}\\n<p style=\\\"text-align:center;\\\">\\n  <span style=\\\"font-size: 95px; font-weight: bold;\\\">15%<\\/span> <span style=\\\"font-size: 55px; font-weight: bold;\\\">off<\\/span>\\n<\\/p>\\n\\n<div class=\\\"offer\\\">\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\",\"footer\":\"<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(11,1,'Order status changed',NULL,6,'Order status changed','{\"header\":\"<h1>Dear {{ customer_name }}<\\/h1>\",\"content\":\"<p>On {{ order.updated_at | format_date }} an order status has been changed to <b>{{ order.status_label }}<\\/b>.<\\/p>\\n<p>The order contains the following items:<\\/p>\\n<table width=\\\"0\\\" border=\\\"0\\\" cellspacing=\\\"5\\\" cellpadding=\\\"10\\\">\\n{% for item in this.all_visible_items %}\\n  <tr>\\n    <td>\\n      <img src=\\\"{{ item.image | resize: \'image\', 300}}\\\" style=\\\"max-width: 15rem\\\"\\/>\\n    <\\/td>\\n    <td valign=\\\"top\\\">\\n      <a href=\\\"{{ item.product.product_url }}\\\">Review {{ item.name }}<\\/a>\\n      <hr>\\n      {{ item.qty_ordered | round }} x {{ item.price | format_price }}\\n    <\\/td>\\n  <\\/tr>\\n{% endfor %}\\n<\\/table>\",\"footer\":\"<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(12,1,'Recently viewed product',NULL,8,'Take another look!','{\"header\":\"<h3>You recently viewed this product<\\/h3>\\n{% if coupon.code %}\\n<div class=\\\"offer\\\">\\n  We highly appreciate each and every our visitor, and it\'s extremely frustrating for us to lose you as a customer.<br>\\n  So let us offer you a <b>discount<\\/b> to complete your purchase.<br>\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\",\"content\":\"<table width=\\\"0\\\" border=\\\"0\\\" cellspacing=\\\"5\\\" cellpadding=\\\"10\\\">\\n  <tr>\\n    <td><img src=\\\"{{ product.image | resize: \'image\', 300}}\\\" style=\\\"max-width: 15rem\\\"\\/><\\/td>\\n    <td valign=\\\"top\\\">\\n      <b><a href=\\\"{{ product.product_url | resume }}\\\">{{ product.name }}<\\/a><\\/b>\\n    <\\/td>\\n  <\\/tr>\\n<\\/table>\",\"footer\":\"{% if crosssell.cross_sell_html %}\\n  <h4 style=\\\"text-align: center\\\">You may also be interested in the following products<\\/h4>\\n{% endif %}\"}','2020-11-18 05:10:27','2020-11-18 05:10:27'),(13,1,'We miss you 2',NULL,9,'We miss you - please come back!','{\"header\":\"<h1>Hello Again!<\\/h1>\",\"content\":\"<h4 style=\\\"text-align:center;\\\">\\n    We noticed you haven\'t visit our store a while. Scroll to find out what you might have missed.\\n<\\/h4>\\n<br><br>\\n\\n{% if coupon.code %}\\n<p style=\\\"text-align:center;\\\">\\n  <span style=\\\"font-size: 95px; font-weight: bold;\\\">15%<\\/span> <span style=\\\"font-size: 55px; font-weight: bold;\\\">off<\\/span>\\n<\\/p>\\n\\n<div class=\\\"offer\\\">\\n  Your coupon code: <span class=\\\"coupon\\\">{{ coupon.code }}<\\/span>\\n<\\/div>\\n{% endif %}\",\"footer\":\"<p>If you have any questions about our products or services, please <a href=\\\"{{ store.store_url }}\\/contact\\/\\\">contact with us.<\\/a><\\/p>\"}','2020-11-18 05:10:27','2020-11-18 05:10:27');
